import React, { Component } from 'react';
import SelectPoblacio from './SelectEspecialitats';
import SelectEspecialitats from "./SelectPoblacio";
import Cards from "./Cards"

class Home extends React.Component {
    render() {

        return (
          <div className="app conteiner">
            <div className="jumbotron">
              <h1 className="lead text-center">Benvinguts</h1>
            </div>
            <div className="container">
              <form>
                <div className="form-row justify-content-center">
                  <div className="form-group col-md-4">
                    <label>Nom restaurant</label>
                    <input ref={this.nom} type="text" className="form-control" placeholder="" />
                  </div>
                  <SelectPoblacio />
                  <SelectEspecialitats />
                  <div className="form-inline">
                    <input type="submit" className="btn btn-danger" value="Cercar"  onClick/>
                  </div>
    
                </div>
              </form>
            </div>
            <div className="container">
              <Cards />
            </div>
          </div>
    
        );
      }
}
export default Home;
